public class Problem032 extends AbstractEulerProblem
{
	/**
	 * Runs the program and prints the solution from the abstracted
	 * getAnswer method in the EulerProblem interface.
	 * 
	 * @param args empty for now
	 */
	public static void main(String[] args)
	{
		Problem032 problem = new Problem032();
		System.out.println("Answer: " + problem.getAnswer());
	}
	/**
	 * We know that the product must be 4 digits long, so we can
	 * start with a list of all 4 digit numbers. We then iterate
	 * through this list and check if the number is a pandigital
	 * product. If it is, we add it to our list of products.
	 * 
	 * @return sum of all pandigital products
	 */
	@Override
	public String getAnswer()
	{
		List<Integer> products = new ArrayList<Integer>();
		for(int i = 1000; i < 10000; i++)
		{
			if(isPandigitalProduct(i))
			{
				products.add(i);
			}
		}
		return Integer.toString(products.stream().mapToInt(i -> i).sum());
	}
	/**
	 * Checks if a given number is a pandigital product.
	 * 
	 * @param num to check
	 * @return true if it is a pandigital product, false otherwise
	 */
	private boolean isPandigitalProduct(int num)
	{
		// we know that the product must be 4 digits long, so we can
		// start with a list of all 4 digit numbers. We then iterate
		// through this list and check if the number is a pandigital
		// product. If it is, we add it to our list of products.
		for(int i = 1; i < num; i++)
		{
			if(num % i == 0 && isPandigital(i, num / i, num))
			{
				return true;
			}
		}
		return false;
	}
	/**
	 * Checks if a given number is a pandigital.
	 * 
	 * @param num to check
	 * @return true if it is a pandigital, false otherwise
	 */
	private boolean isPandigital(int... num)
	{
		// we need to check if the number is a pandigital
		// we can do this by creating a set of all the digits
		// in the number and comparing it to a set of all
		// the digits 1 through 9. If they are equal, then
		// the number is a pandigital.
		Set<Integer> digits = new HashSet<Integer>();
		for(int i : num)
		{
			for(char c : Integer.toString(i).toCharArray())
			{
				digits.add(Character.getNumericValue(c));
			}
		}
		return digits.size() == 9 && !digits.contains(0);
	}
}

