public class Problem93 {
    public static void main(String[] args) {
        int max = 0;
        for (int a = 1; a <= 4; a++) {
            for (int b = 1; b <= 4; b++) {
                if (b == a) continue;
                for (int c = 1; c <= 4; c++) {
                    if (c == a || c == b) continue;
                    int d = 6 - a - b - c;
                    int[] nums = {a, b, c, d};
                    int[] ops = {0, 1, 2, 3};
                    int[] results = new int[24];
                    int index = 0;
                    do {
                        int result = calculate(nums, ops);
                        if (result > 0 && result < 1000000 && isPermutation(result, nums)) {
                            results[index++] = result;
                        }
                    } while (nextPermutation(ops));
                    Arrays.sort(results);
                    int maxResult = results[23];
                    if (maxResult > max) {
                        max = maxResult;
                    }
                }
            }
        }
        System.out.println(max);
    }

    private static int calculate(int[] nums, int[] ops) {
        int result = nums[0];
        for (int i = 0; i < 3; i++) {
            switch (ops[i]) {
                case 0:
                    result += nums[i + 1];
                    break;
                case 1:
                    result -= nums[i + 1];
                    break;
                case 2:
                    result *= nums[i + 1];
                    break;
                case 3:
                    result /= nums[i + 1];
                    break;
            }
        }
        return result;
    }

    private static boolean nextPermutation(int[] array) {
        int i = array.length - 1;
        while (i > 0 && array[i - 1] >= array[i]) {
            i--;
        }
        if (i <= 0) {
            return false;
        }
        int j = array.length - 1;
        while (array[j] <= array[i - 1]) {
            j--;
        }
        int temp = array[i - 1];
        array[i - 1] = array[j];
        array[j] = temp;
        j = array.length - 1;
        while (i < j) {
            temp = array[i];
            array[i] = array[j];
            array[j] = temp;
            i++;
            j--;
        }
        return true;
    }

    private static boolean isPermutation(int n, int[] nums) {
        int[] digits = new int[10];
        while (n > 0) {
            digits[n % 10]++;
            n /= 10;
        }
        for (int num : nums) {
            while (num > 0) {
                digits[num % 10]--;
                num /= 10;
            }
        }
        for (int digit : digits) {
            if (digit != 0) {
                return false;
            }
        }
        return true;
    }
}

